INSERT INTO `event_details` (`EventID`, `EventName`, `EventDate`, `EventTime`, `EventCategory`, `EventDescription`, `EventTicketPrice`, `EventTicketTotal`, `EventTicketSold`, `VenueID`, `UserID`) VALUES
(1, 'Applications of modern chemistry', '2024-01-03', '09:00:00', 'Education', 'Delving into the multifaceted ways modern chemistry influences various fields, the talk will explore recent breakthroughs in chemical research, emphasizing their practical applications and impact on real-world issues. including advancements in materials science, drug discovery, environmental sustainability, nanotechnology, and other interdisciplinary areas where chemistry plays a pivotal role.', 5, 50000, 3, 2, 'AUTAR002'),
(2, 'Anatomy of the human body: how we can maximize our energy.', '2024-02-01', '10:00:00', 'Health', 'Exploring the physiological aspects of the human body and offers insights into optimizing energy levels.', 16, 300, 3, 3, 'AUTAR001'),
(3, 'The Importance of Critical Thinking in the World of Business', '2024-02-08', '08:00:00', 'Education', 'In today\'s dynamic and ever-evolving business landscape, the ability to think critically is a cornerstone of success. Join us for an engaging exploration of \"The Importance of Critical Thinking in the World of Business,\" where we delve into the profound impact that critical thinking skills can have on decision-making and problem-solving within the corporate realm.\nA total of 700 players from Canada, Denmark, Bangladesh, Japan, Iraq, India, Indonesia, Hong Kong, Macau, Maldives, Sri Lanka, Singapore, Philippines, Vietnam and Thailand competed in junior, senior and veteran age group categories. ', 50, 1000, 2, 5, 'AUTAR001'),
(4, 'AI in modern image classification and identification', '2024-01-10', '10:00:00', 'Technology', 'In this engaging talk, we\'ll delve into the underlying principles of AI-driven image classification, unraveling the sophisticated algorithms and neural networks that enable machines to interpret and categorize visual information. From recognizing objects and patterns to discerning intricate details, AI is redefining the possibilities of image identification with unprecedented accuracy and efficiency.', 12, 50000, 2, 1, 'AUTAR002'),
(5, 'Empowering Citizens: Know Your Rights in Egypt', '2024-01-05', '10:40:00', 'Education', 'In this talk, we shine a spotlight on the fundamental rights every citizen holds in this diverse and historically rich nation. Join us for an informative session that aims to equip individuals with the knowledge and understanding needed to navigate the legal landscape, fostering a culture of awareness and empowerment.\nAn amalgamation of dance music with a traditional Thai watering festival: youâ€™re basically paying to get drenched in water whilst raving to the worldâ€™s top DJs - not bad, right? Last yearâ€™s festival welcomed DJ Snake, Oliver Heldens, and Krewalla.\n\n***For more information, please visit: S20Songkranâ€***', 150, 15000, 6, 6, 'AUTAR001'),
(6, 'Architecting skyscrapers: how skyscraper are engineered.', '2024-01-13', '10:00:00', 'Education', 'Dive into the awe-inspiring world of skyscraper architecture. This immersive session will unravel the intricate design and engineering principles behind these towering structures that define modern cityscapes.\n\nThe event will explore key elements such as materials selection, foundation engineering, and cutting-edge construction techniques that enable architects and engineers to push the limits of height and design. Attendees can expect a virtual tour of iconic skyscrapers, learning about the challenges faced and the ingenious solutions devised to overcome them.\nShow runs every half an hour.', 0, 10000, 5, 7, 'AUTAR005'),
(7, 'Crafting and Publishing Your First Medical Research Paper.', '2024-02-04', '12:00:00', 'Academic', 'Tailored for aspiring researchers, healthcare professionals, and students, this session provides invaluable insights into the intricate process of producing and publishing impactful research in the field of medicine.\n\nThe event will delve into the essential elements of effective scientific writing, including clarity, precision, and adherence to established formatting and citation styles. Practical tips on organizing data, constructing compelling arguments, and addressing potential challenges will empower participants to elevate the quality and impact of their research papers.', 16, 200, 4, 3, 'AUTAR001');

